\newmintinline[lean]{lean4.py:Lean4Lexer -x}{bgcolor=white}
\newminted[leancode]{lean4.py:Lean4Lexer -x}{fontsize=\footnotesize}
\usemintedstyle{tango} % a nice, colorful theme \begin{document}
\begin{leancode}
theorem funext {f₁ f₂ : ∀ (x : α), β x} (h : ∀ x, f₁ x = f₂ x) : f₁ = f₂ := by show extfunApp (Quotient.mk' f₁) = extfunApp (Quotient.mk' f₂) apply congrArg apply Quotient.sound exact h
\end{leancode}
\end{document} If your version of minted is v2.7 or newer, but before v3.0, you will additionally need to follow the workaround described in https://github.com/gpoore/minted/issues/360. You can then compile test.tex by executing the following command: xelatex --shell-escape test.tex Some remarks: either xelatex or lualatex is required to handle Unicode characters in the code. --shell-escape is needed to allow xelatex to execute pygmentize in a shell. If the chosen monospace font is missing some Unicode symbols, you can direct them to be displayed using a fallback font or other replacement LaTeX code. \usepackage{newunicodechar}
