Now that we have all we need on the server side, let's write the widget source. By importing @leanprover/infoview, widgets can render UI components used to implement the infoview itself. For example, the <InteractiveCode> component displays expressions with term : type tooltips as seen in the goal view. We will use it to implement our custom #check display. ⚠️ WARNING: Like the other widget APIs, the infoview JS API is unstable and subject to breaking changes. The code below demonstrates useful parts of the API. To make RPC method calls, we use the RpcContext. The useAsync helper packs the results of a call into an AsyncState structure which indicates whether the call has resolved successfully, has returned an error, or is still in-flight. Based on this we either display an InteractiveCode with the type, mapRpcError the error in order to turn it into a readable message, or show a Loading.. message, respectively. @[widget_module]
def checkWidget: Widget.ModulecheckWidget : Widget.Module: TypeWidget.Module where javascript := "
import * as React from 'react';
const e = React.createElement;
import { RpcContext, InteractiveCode, useAsync, mapRpcError } from '@leanprover/infoview'; export default function(props) { const rs = React.useContext(RpcContext) const [name, setName] = React.useState('getType') const st = useAsync(() =&gt; rs.call('getType', { name, pos: props.pos }), [name, rs, props.pos]) const type = st.state === 'resolved' ? st.value &amp;&amp; e(InteractiveCode, {fmt: st.value}) : st.state === 'rejected' ? e('p', null, mapRpcError(st.error).message) : e('p', null, 'Loading..') const onChange = (event) =&gt; { setName(event.target.value) } return e('div', null, e('input', { value: name, onChange }), ' : ', type)
}
": String"
